import Navbar from '../components/Navbar';
import { useLocation } from 'react-router-dom';

const SearchRecipe = () => {
    const location = useLocation();
    const name = location.state.name;

    return (
        <div>
            {name && <Navbar name={name} />}
            <div>
            </div>

            </div>
            )
}

            export default SearchRecipe
